sections.code:
body,
#content,
#mw-head,
#mw-page-base {
    background: #F4EEE6;
}

#toc,
.infobox {
    background: #F8F3EB;
}

#mw-content-text > div > table {
    background: #F8F3EB !important;
}

body {
    font-family: Lora, serif;
    font-size: 1.5em;
}

h1 {
    border-bottom: none;
    font-family: Lora, serif;
}

#content {
    max-width: 58%
}

#content {
    border: none;
}

#mw-panel {
    display: none;
}

#p-personal,
#left-navigation,
#p-views {
    display: none;
}

#p-navigation,
#p-interaction,
#p-tb,
#p-wikibase-otherprojects,
#p-coll-print_export {
    display: none;
}

body {
    font-size: 1.16em;
    font-family: Lora, serif;
    background: #F1EAE2;
    color: #232323;
}

h1,
h2,
h3,
h4,
h5 {
    font-family: Lora, serif;
    font-weight: bold;
}

dl dt,
dl dd {
    font-size: 1.15em;
}

p {
    line-height: 1.4em;
}

#page {
    max-width: 61.8%;
    margin: auto;
}

pre {
    background: #F8F3EB;
    font-size: 0.85em
}

p,
li {
    max-width: 100%
}
